import React from 'react'

export default function Sections() {

  return (
    <div className="column-section">
      <div className="column">Legal Rights</div>
      <div className="column">Constitution</div>
      <div className="column">Community forum</div>
      <div className="column">History of cases</div>
    </div>
  )

}
